INSERT INTO problems (id, name, text, abbrev, memlimit, seriesid, classesid, pdfid, config) VALUES (56, 'Problem Euklidesa', '<h1>Wstęp</h1>
Dawno, dawno temu pewien uczony mędrzec Euklides miał zagadkę nie do rozwiązania. Myślał, myślał i nie mógł znaleźć odpowiedzi na nurtujące go pytanie: "Jak znaleźć największą liczbę naturalna taka, aby dzieliła dwie wybrane liczby naturalne?". Pomóż Euklidesowi rozwiązać dręczący go problem...
<h1>Zadanie</h1>
Napisz program, który dla każdego zestawu danych:

    * Wczytuje liczby a,b ze standardowego wejścia,
    * Oblicza wartość NWD(a,b),
    * Wypisuje wynik na standardowe wyjście. 

<h2>Wejście</h2>
Pierwsza linia zawiera dokładnie jedna liczbę n, 1 ≤ n ≤ 50000, będąca liczba zestawów danych. W n kolejnych liniach występują poszczególne zestawy danych. Każdy zestaw składa się z dwóch liczb a,b, 1 ≤ a,b ≤ 100000000, oddzielonych pojedynczą spacją.
<h2>Wyjście</h2>
Program powinien wypisać na standardowe wyjście n linii. I-ta linia powinna zawierać dokładnie jedna liczbę naturalna, będącą największym wspólnym dzielnikiem liczb występujących w i-tym zestawie danych.
<h1>Przykład</h1>
Dla następującego wejścia:
<div>
3
2 6
4 14
5 7
</div>
poprawnym rozwiązaniem jest:
<div>
2
2
1
</div>', 'GCD', 10000, 19, 8, NULL, NULL);
INSERT INTO problems (id, name, text, abbrev, memlimit, seriesid, classesid, pdfid, config) VALUES (7, 'Całka', '<h1>Wstęp</h1>
Obliczyć całkę od 0 do n z funkcji f(x)=x<sup>15</sup>.

<h2>Wejście:</h2>
W pierwszej i jedynej linii wejścia znajduje się liczba naturalna 0 < n < 5.

<h2>Wyjście:</h2>
Obliczona wartość całki.

<h1>Przykład</h1>
